import React from 'react';
import {Grid} from '@material-ui/core';

const Profile = () => {
    return ( 
      <Grid container direction="coloumn">
          <Grim item>
              This is where header will be
          </Grim>
          <Grid item>
              Heloolloaoa
          </Grid>
      </Grid>
    );
}
 
export default Profile;
